    "import pandas as pd\n",
    "import numpy as np\n",
    "import matplotlib.pyplot as plt\n",
    "import seaborn as sns\n",
    "from sklearn.metrics import mean_absolute_error, mean_squared_error, r2_score\n",
    "\n",
    "# Ensure region names are uppercase and categorical\n",
    "results_df['region'] = results_df['region'].astype(str).str.upper()\n",
    "all_regions = ['R1', 'R2', 'R3', 'R4', 'R5']\n",
    "results_df['region'] = pd.Categorical(results_df['region'], categories=all_regions, ordered=True)\n",
    "\n",
    "# ----- 1️⃣ COMPUTE METRICS PER REGION -----\n",
    "metrics_list = []\n",
    "for region in all_regions:\n",
    "    subset = results_df[results_df['region'] == region].copy()\n",
    "    subset = subset.dropna(subset=['actual', 'rf_refined'])  # Drop NaNs\n",
    "\n",
    "    if subset.empty or len(subset) < 2:\n",
    "        # Region missing or too few samples\n",
    "        metrics_list.append({\n",
    "            \"Region\": region,\n",
    "            \"MAE\": np.nan,\n",
    "            \"RMSE\": np.nan,\n",
    "            \"R²\": np.nan,\n",
    "            \"Accuracy (±0.5)\": np.nan\n",
    "        })\n",
    "        continue\n",
    "\n",
    "    mae = mean_absolute_error(subset['actual'], subset['rf_refined'])\n",
    "    rmse = np.sqrt(mean_squared_error(subset['actual'], subset['rf_refined']))\n",
    "    r2 = r2_score(subset['actual'], subset['rf_refined'])\n",
    "    acc = (abs(subset['actual'] - subset['rf_refined']) <= 0.5).mean() * 100\n",
    "\n",
    "    metrics_list.append({\n",
    "        \"Region\": region,\n",
    "        \"MAE\": mae,\n",
    "        \"RMSE\": rmse,\n",
    "        \"R²\": r2,\n",
    "        \"Accuracy (±0.5)\": acc\n",
    "    })\n",
    "\n",
    "region_metrics = pd.DataFrame(metrics_list)\n",
    "print(\"📊 Region-wise Performance Summary:\")\n",
    "print(region_metrics)\n",
    "\n",
    "# Replace NaN with 0 for plotting clarity\n",
    "region_metrics_plot = region_metrics.fillna(0)\n",
    "\n",
    "# ----- 2️⃣ GROUPED BAR PLOT -----\n",
    "melted = region_metrics_plot.melt(\n",
    "    id_vars='Region',\n",
    "    value_vars=['MAE', 'RMSE', 'Accuracy (±0.5)'],\n",
    "    var_name='Metric',\n",
    "    value_name='Value'\n",
    ")\n",
    "\n",
    "plt.figure(figsize=(10,6))\n",
    "sns.barplot(data=melted, x='Region', y='Value', hue='Metric', palette='Set2')\n",
    "plt.title(\"Region-wise Performance Metrics – Hybrid Meta-LSTM\", fontsize=12, weight='bold')\n",
    "plt.ylabel(\"Value\")\n",
    "plt.xlabel(\"Region\")\n",
    "plt.legend(title=\"Metric\")\n",
    "plt.grid(alpha=0.3, linestyle='--')\n",
    "plt.tight_layout()\n",
    "plt.savefig(BASE_DIR / \"region_wise_bar_metrics.png\", dpi=200, bbox_inches='tight')\n",
    "plt.show()\n",
    "\n",
    "# ----- 3️⃣ SEPARATE PLOT FOR R² -----\n",
    "plt.figure(figsize=(8,5))\n",
    "sns.barplot(data=region_metrics_plot, x='Region', y='R²', color='skyblue', edgecolor='black')\n",
    "plt.title(\"Region-wise R² Scores – Hybrid Meta-LSTM\", fontsize=12, weight='bold')\n",
    "plt.ylabel(\"R² Score\")\n",
    "plt.ylim(0, 1)\n",
    "plt.grid(alpha=0.3, linestyle='--')\n",
    "plt.tight_layout()\n",
    "plt.savefig(BASE_DIR / \"region_wise_r2.png\", dpi=200, bbox_inches='tight')\n",
    "plt.show()\n",
    "\n",
    "print(\"✅ Region-wise metric plots saved: 'region_wise_bar_metrics.png' & 'region_wise_r2.png'\")\n"
