    "import pandas as pd\n",
    "import matplotlib.pyplot as plt\n",
    "import numpy as np\n",
    "from pathlib import Path\n",
    "\n",
    "BASE_DIR = Path(r\"C:\\Users\\SAANVI\\Downloads\\cloud_autoscaler_project\")\n",
    "regions = [f\"r{i}\" for i in range(1,6)]\n",
    "\n",
    "# Step 1: Load all region parquet files\n",
    "data = []\n",
    "for r in regions:\n",
    "    file = BASE_DIR / \"data\" / \"processed\" / f\"{r}_d0_to_d30_hourly.parquet\"\n",
    "    df = pd.read_parquet(file)\n",
    "    df['region'] = r.upper()\n",
    "    data.append(df)\n",
    "\n",
    "full_df = pd.concat(data, ignore_index=True)\n",
    "print(f\"Loaded total {len(full_df):,} records across {len(regions)} regions\")\n",
    "\n",
    "# Step 2: Compute cost metrics\n",
    "full_df['total_cost'] = full_df['cold_latency_mean'] + full_df['pod_changes'] * 0.01\n",
    "\n",
    "# Static: assume always-on pods (no scaling)\n",
    "static_cost = full_df['total_cost'].mean()\n",
    "\n",
    "# Reactive: scales after cold start → partial savings\n",
    "reactive_cost = static_cost * (1 - 0.25 * (full_df['cold_count'] > 0).mean())\n",
    "\n",
    "# Predictive: use your hybrid model results (already refined)\n",
    "results = pd.read_csv(BASE_DIR / \"final_model_results.csv\")\n",
    "predictive_cost = reactive_cost * (1 - results['rf_refined'].mean() / (results['actual'].mean() + 1e-6))\n",
    "\n",
    "# Normalize all\n",
    "norm_factor = max(static_cost, reactive_cost, predictive_cost)\n",
    "costs = [static_cost/norm_factor, reactive_cost/norm_factor, predictive_cost/norm_factor]\n",
    "\n",
    "# Step 3: Plot comparative cost efficiency\n",
    "labels = ['Static Scaling', 'Reactive Scaling', 'Predictive (Hybrid Meta-LSTM)']\n",
    "\n",
    "plt.figure(figsize=(8,5))\n",
    "bars = plt.bar(labels, costs, color=['#f66', '#6cf', '#4c9'])\n",
    "plt.ylabel('Normalized Total Cost')\n",
    "plt.title('Comparative Cost Efficiency of Autoscaling Models', fontsize=12, weight='bold')\n",
    "plt.ylim(0, 1.1)\n",
    "plt.grid(axis='y', linestyle='--', alpha=0.3)\n",
    "for bar in bars:\n",
    "    height = bar.get_height()\n",
    "    plt.text(bar.get_x() + bar.get_width()/2, height + 0.03, f\"{height:.2f}\", ha='center', fontsize=10)\n",
    "plt.tight_layout()\n",
    "plt.savefig(BASE_DIR / \"actual_cost_efficiency_comparison.png\", dpi=200, bbox_inches='tight')\n",
